import Footer from "./Components/Footer";
import Navbar from "./Components/Navbar";
import AppProvider from './Context/appContext';
import Routes from './Routes/AppRouter'


function App() {
  return (
      <div className="App">
          <Navbar/>
          <Router>
            <AppProvider>
              <Routes/>
            </AppProvider>
          </Router>
          <Footer/>
      </div>
  );
}

export default App;
